import './App.css';
import Profile from './components/Profile.js';
import { Container, Row, Col } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Row className="text-left">
        <Col md={6} lg={6}>
          <Profile />
        </Col>
      </Row>


        <Profile/>
      </header>
    </div>
  );
}

export default App;
